<!DOCTYPE html>
<html lang="ja">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <title>津田の時系列並び替えクイズ</title>

  <!-- EmailJS -->
  <script src="https://cdn.jsdelivr.net/npm/emailjs-com@3/dist/email.min.js"></script>

  <style>
    body {
      font-family: sans-serif;
      margin: 0;
      padding: 16px;
      background: #f5f5f5;
    }
    h1 { text-align: center; }

    input {
      display: block;
      margin: 12px auto;
      padding: 8px;
      font-size: 16px;
      width: 240px;
    }

    #guide {
      display: flex;
      justify-content: space-between;
      max-width: 1000px;
      margin: 0 auto 12px;
      font-weight: bold;
    }

    #quiz {
      display: flex;
      gap: 12px;
      flex-wrap: wrap;
      justify-content: center;
    }

    .item {
      background: white;
      border: 2px solid #ccc;
      border-radius: 8px;
      padding: 8px;
      cursor: grab;
    }

    .item.dragging { opacity: 0.5; }

    .item img {
      max-width: 160px;
      border-radius: 4px;
    }

    button {
      display: block;
      margin: 24px auto;
      padding: 12px 24px;
      font-size: 16px;
      border-radius: 8px;
      border: none;
      background: #1976d2;
      color: white;
    }

    .item.correct {
      border: 3px solid red;
    }

    #result {
      text-align: center;
      font-size: 18px;
      font-weight: bold;
      white-space: pre-line;
      margin-top: 12px;
    }

    #correct-images {
      display: flex;
      gap: 12px;
      flex-wrap: wrap;
      justify-content: center;
      margin-top: 16px;
    }

    .correct-item {
      background: white;
      border: 2px solid #4caf50;
      border-radius: 8px;
      padding: 6px;
      text-align: center;
      font-size: 12px;
    }

    .correct-item img {
      max-width: 140px;
      display: block;
      margin-bottom: 4px;
      border-radius: 4px;
    }


  </style>
</head>
<body>

<h1>津田の時系列並び替えクイズ</h1>

<input id="nickname" placeholder="ニックネームを入力">

<p style="text-align:center">
  写真をドラッグ＆ドロップして正しい時系列に並び替えてください。
</p>

<div id="guide">
  <span>← 古い</span>
  <span>新しい →</span>
</div>

<div id="quiz"></div>

<button id="check">判定</button>

<div id="result"></div>
<div id="correct-images"></div>
